import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
<Head>
        <title>MASDA LIVERPOOL</title>
        <meta name="description" content="Train hard, fight smart, and elevate at Masda Liverpool." />
</Head>
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
